<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">

  <title>Anagenetic</title>
</head>
<body>
  <canvas id="canvas"></canvas>
  <div id="uiWrapper" class="input-disabled">
    <div id="uiRoot">
  </div>

  <ins name="button">
    <button class="button blue">
      Text
    </button>
  </ins>

  <ins name="simulation-ui">
    <div class="simulation-ui hidden">
    </div>
  </ins>

  <ins name="main-screen">
    <div class="main-screen input-enabled">
      <placeholder></placeholder>
    </div>
  </ins>

  <ins name="genome-library">
    <div class="genome-library-wrapper">
      <placeholder name="buttons-line"></placeholder>
      <div class="genome-library-content-wrapper">
        <placeholder name="genomes-list"></placeholder>
        <placeholder name="side-panel"></placeholder>
      </div>
    </div>
  </ins>

  <ins name="buttons-line">
    <div class="buttons-line"></div>
  </ins>

  <ins name="genomes-list">
    <div class="genomes-list-wrapper">
      Genomes list
    </div>
  </ins>

  <ins name="genome-panel">
    <div class="genome-panel">
      <placeholder name="header"></placeholder>
      <placeholder name="genome"></placeholder>
      <placeholder name="buttons"></placeholder>
    </div>
  </ins>

  <ins name="zoom-controls">
    <div class="zoom-controls input-enabled">
      <i class="fa fa-plus zoom-button zoom-in"></i>
      <i class="fa fa-minus zoom-button zoom-out"></i>
    </div>
  </ins>

  <ins name="open-panel-button">
    <div class="open-panel-button input-enabled">
      <i class="fa fa-bars"></i>
    </div>
  </ins>

  <ins name="simulation-controls">
    <div class="simulation-controls">
      <i class="fa fa-play-circle control-button play-button"></i>
      <i class="fa fa-pause-circle control-button pause-button"></i>

      <input type="range" min="0" max="4" value="2" class="slider speed-slider">

      <span class="speed-text">x0.25</span>

      <i class="fa fa-power-off control-button stop-button"></i>
    </div>
  </ins>

  <ins name="side-panel">
    <div class="side-panel input-enabled panel-hidden">
      <placeholder></placeholder>
    </div>
  </ins>

  <ins name="cell-side-panel-content">
    <div class="cell-side-panel-content">
      <placeholder name="header"></placeholder>
      <placeholder name="cell-info"></placeholder>
      <placeholder name="genome"></placeholder>
      <placeholder name="buttons"></placeholder>
    </div>
  </ins>

  <ins name="menu-side-panel-content">
    <div class="menu-side-panel-content">
      <placeholder name="header"></placeholder>
      <placeholder name="buttons"></placeholder>
    </div>
  </ins>

  <ins name="analysis-side-panel-content">
    <div class="analysis-side-panel-content">
      <placeholder name="header"></placeholder>
      <placeholder name="data"></placeholder>
      <placeholder name="buttons"></placeholder>
    </div>
  </ins>

  <ins name="side-panel-header">
    <div class="side-panel-header">
      <placeholder></placeholder>
      <i class="fa fa-times-circle close-button"></i>
    </div>
  </ins>

  <ins name="cell-info-wrapper">
    <div class="cell-info-wrapper">
    </div>
  </ins>

  <ins name="cell-info-item">
    <div class="cell-info-item">
      <div class="cell-info-key">
        <placeholder name="key"></placeholder>
      </div>

      <div class="cell-info-value">
        <placeholder name="value"></placeholder>
      </div>
    </div>
  </ins>

  <ins name="analytic-info-wrapper">
    <div class="analytic-info-wrapper">
    </div>
  </ins>

  <ins name="analytic-info-item">
    <div class="analytic-info-item">
      <div class="analytic-info-key">
        <placeholder name="key"></placeholder>
      </div>

      <div class="analytic-info-value">
        <placeholder name="value"></placeholder>
      </div>
    </div>
  </ins>

  <ins name="genome-table">
    <div class="genome-table-wrapper">
    </div>
  </ins>

  <ins name="gene-item">
    <div class="gene-item"></div>
  </ins>

  <ins name="genome-viewer">

      <placeholder name="descriptor"></placeholder>
    </div>
  </ins>

  <ins name="gene-descriptor">
